INSERT INTO public.audit_deltas VALUES ('9f8e491c-d490-4d1c-a768-3321a59cb099', 'ca1b63b1-9ea9-4736-ad8a-76865c0c068b', 'disease_current', '<p>Probando<br></p>', '<p>Se trata de paciente femenino de 34 años de edad, natural del estado portuguesa y procedente de la localidad quien acude a a consulta médica el día de hoy, por referir IEA hace 1 semana&nbsp; aproximadamente caracterizado por presentar dolor en el oído derecho . En vista de persistir sintomatología acude se evalúa y se decide conducta médica respectiva.</p>');
