INSERT INTO public.audit_deltas VALUES ('b6a6ec35-51a1-4342-9ec7-53a7f9e9b3e2', 'e75583a8-f213-4955-9069-c2532e230aa9', 'suggestions', '<p>NINGUNA.</p>', '<p><span style="font-family: Arial;">Es importante e indispensable tener la vejiga llena, cuando se hace un ultrasonido pélvico. Al estar llena la vejiga desplazara a los intestinos y la vejiga actúa como una ventana para el paso de las ondas ultrasónicas.&nbsp;</span><span style="font-family: Arial;">Esto nos permitirá&nbsp; ver los órganos pélvicos.</span><br></p>');
