INSERT INTO public.audit_deltas VALUES ('72fb13f6-8148-497b-9a22-4a2f7b3bfac5', '567f585d-4947-406b-90be-0d6294f2ad52', 'treatment_sequence', '<p>Probandoooooooooooooooooooooooooooooooooooooooooooooooooooooooooooo<br></p>', '<ul style="margin-right: 0px; margin-bottom: 0px; margin-left: 36px; padding: 0px 0px 24px;"><li style="line-height: 1.4em; margin-bottom: 12px;">Tratamientos con flúor.&nbsp;Si una caries recién está comenzando a aparecer, el tratamiento con flúor puede ayudarte a restaurar el esmalte del diente y, en ocasiones, a revertir la caries en etapas muy tempranas. Los tratamientos profesionales con flúor contienen más flúor que la cantidad que se encuentra en el agua del grifo, los dentífricos y los enjuagues bucales. Los tratamientos con flúor pueden ser líquidos, en gel, espuma o barniz que se cepilla en los dientes o se coloca en una cubeta pequeña que se ajusta a los dientes.</li><li style="line-height: 1.4em; margin-bottom: 12px;">Empastes.&nbsp;Los empastes, a veces llamados «restauraciones», son la opción principal de tratamiento cuando la caries ha avanzado más allá de la primera etapa. Los empastes se hacen con varios materiales, como resinas compuestas del color del diente, porcelana o una amalgama dental que es una combinación de diferentes materiales.</li><li style="line-height: 1.4em; margin-bottom: 12px;"><font color="#111111" face="Helvetica, Arial, sans-serif"><span style="font-size: 16px;">Coronas.</span></font>&nbsp;Si tienes caries extensas o dientes debilitados, es posible que necesites una corona: una cubierta hecha a medida que reemplaza la corona natural completa del diente. El dentista pasará el torno en la zona de la caries y en otras partes del diente para asegurar un buen ajuste. Las coronas pueden ser de oro, porcelana de alta resistencia, resina, porcelana fundida en metal o de otros materiales.</li></ul>');
