INSERT INTO public.audits VALUES ('c4b1f1fd-f446-49e4-a177-974c50a2718c', 'EDIT', 'ClinicalHistories', '18', '{"id":18,"person_id":493,"beneficiary_id":null,"blood_type_id":null,"doctor_id":2,"workplan":null,"peso":0,"altura":null,"fr":null,"fc":null,"ta":null,"reason_consultation":"Dolor en la muela derecha.","imc":null,"tp":null,"cms":null,"saturacion":null,"disease_current":null,"physical_test":null,"observations":null,"diagnostic_impression":null,"suggestions":null,"laboratory_conclusions":null,"radiographic_interpretation":null,"treatment_sequence":"<p>Probandoooooooooooooooooooooooooooooooooooooooooooooooooooooooooooo<br><\/p>","dental_diagnosis":"<p>Caries limitada al esmalte.<\/p><p>Caries de la dentina.&nbsp;<\/p><p>.Caries del cemento.<br><\/p>"}', NULL, '3', '2022-12-08 15:12:17.150153', 1, '172.16.202.200', 'http://172.17.2.98/SAPS/doctor/informe/editar/18');
INSERT INTO public.audits VALUES ('bb9eae2b-b2e4-4ad4-92fb-65fe55ac2372', 'EDIT', 'ClinicalHistories', '18', '{"id":18,"person_id":493,"beneficiary_id":null,"blood_type_id":null,"doctor_id":2,"workplan":null,"peso":0,"altura":null,"fr":null,"fc":null,"ta":null,"reason_consultation":"Dolor en la muela derecha.","imc":null,"tp":null,"cms":null,"saturacion":null,"disease_current":null,"physical_test":null,"observations":null,"diagnostic_impression":null,"suggestions":null,"laboratory_conclusions":null,"radiographic_interpretation":null,"treatment_sequence":"<ul style=\"margin-right: 0px; margin-bottom: 0px; margin-left: 36px; padding: 0px 0px 24px;\"><li style=\"line-height: 1.4em; margin-bottom: 12px;\">Tratamientos con fl\u00faor.&nbsp;Si una caries reci\u00e9n est\u00e1 comenzando a aparecer, el tratamiento con fl\u00faor puede ayudarte a restaurar el esmalte del diente y, en ocasiones, a revertir la caries en etapas muy tempranas. Los tratamientos profesionales con fl\u00faor contienen m\u00e1s fl\u00faor que la cantidad que se encuentra en el agua del grifo, los dent\u00edfricos y los enjuagues bucales. Los tratamientos con fl\u00faor pueden ser l\u00edquidos, en gel, espuma o barniz que se cepilla en los dientes o se coloca en una cubeta peque\u00f1a que se ajusta a los dientes.<\/li><li style=\"line-height: 1.4em; margin-bottom: 12px;\">Empastes.&nbsp;Los empastes, a veces llamados \u00abrestauraciones\u00bb, son la opci\u00f3n principal de tratamiento cuando la caries ha avanzado m\u00e1s all\u00e1 de la primera etapa. Los empastes se hacen con varios materiales, como resinas compuestas del color del diente, porcelana o una amalgama dental que es una combinaci\u00f3n de diferentes materiales.<\/li><li style=\"line-height: 1.4em; margin-bottom: 12px;\"><font color=\"#111111\" face=\"Helvetica, Arial, sans-serif\"><span style=\"font-size: 16px;\">Coronas.<\/span><\/font>&nbsp;Si tienes caries extensas o dientes debilitados, es posible que necesites una corona: una cubierta hecha a medida que reemplaza la corona natural completa del diente. El dentista pasar\u00e1 el torno en la zona de la caries y en otras partes del diente para asegurar un buen ajuste. Las coronas pueden ser de oro, porcelana de alta resistencia, resina, porcelana fundida en metal o de otros materiales.<\/li><\/ul>","dental_diagnosis":"<p>Caries limitada al esmalte.<\/p><p>Caries de la dentina.&nbsp;<\/p><p><span style=\"font-size: 0.875rem;\">Caries del cemento.<\/span><\/p>"}', NULL, '3', '2022-12-08 15:19:22.85057', 1, '172.16.202.200', 'http://172.17.2.98/SAPS/doctor/informe/editar/18');
INSERT INTO public.audits VALUES ('dfb1663f-92e1-4a5f-8dc1-9c7fd5c55c10', 'EDIT', 'ClinicalHistories', '19', '{"id":19,"person_id":493,"beneficiary_id":null,"blood_type_id":null,"doctor_id":2,"workplan":null,"peso":0,"altura":null,"fr":null,"fc":null,"ta":null,"reason_consultation":"Dolor en el diente por ca\u00edda.","imc":null,"tp":null,"cms":null,"saturacion":null,"disease_current":null,"physical_test":null,"observations":null,"diagnostic_impression":null,"suggestions":null,"laboratory_conclusions":null,"radiographic_interpretation":null,"treatment_sequence":"<ul style=\"font-family: Helvetica, Arial, sans-serif; margin-right: 0px; margin-bottom: 0px; margin-left: 36px; padding: 0px 0px 24px; color: rgb(17, 17, 17); font-size: 16px;\"><li style=\"line-height: 1.4em; margin-bottom: 12px;\"><strong>Tratamientos con fl\u00faor.<\/strong>&nbsp;Si una caries reci\u00e9n est\u00e1 comenzando a aparecer, el tratamiento con fl\u00faor puede ayudarte a restaurar el esmalte del diente y, en ocasiones, a revertir la caries en etapas muy tempranas. Los tratamientos profesionales con fl\u00faor contienen m\u00e1s fl\u00faor que la cantidad que se encuentra en el agua del grifo, los dent\u00edfricos y los enjuagues bucales. Los tratamientos con fl\u00faor pueden ser l\u00edquidos, en gel, espuma o barniz que se cepilla en los dientes o se coloca en una cubeta peque\u00f1a que se ajusta a los dientes.<\/li><\/ul>","dental_diagnosis":"<p>Fractura.<\/p>"}', NULL, '3', '2022-12-08 15:19:39.419388', 1, '172.16.202.200', 'http://172.17.2.98/SAPS/doctor/informe/editar/19');
