INSERT INTO public.audits VALUES ('ba2fa2d1-612e-49b6-99b3-06cccf481558', 'EDIT', 'Laboratories', '10', '{"id":10,"clinical_history_id":14,"descripcion":"<span class=\"ILfuVd\" lang=\"es\"><span class=\"hgKElc\">Los ex\u00e1menes paracl\u00ednicos <b>son \u00fatiles para ayudar a establecer la severidad del problema y para confirmar el diagn\u00f3stico basado en la sospecha cl\u00ednica<\/b>.\r\n Los \"ex\u00e1menes de rutina\" rara vez son de ayuda y el chance de falsos \r\npositivos, que pueden confundir el diagn\u00f3stico, aumenta con el n\u00famero de\r\n ex\u00e1menes realizados.<\/span><\/span>","created":"2022-12-08T19:35:53+00:00","modified":"2022-12-09T18:31:11+00:00"}', 'JORFRAN JESUS SALAZAR MATA', '1', '2022-12-09 18:31:11.495707', 1, '127.0.0.1', 'http://localhost/SAPS/admin/laboratorio/editar/10');
