INSERT INTO public.audits VALUES ('1120cdce-e56c-4cb8-bada-444f8c677c98', 'EDIT', 'ClinicalHistories', '19', '{"id":19,"person_id":493,"beneficiary_id":null,"blood_type_id":null,"doctor_id":2,"workplan":null,"peso":0,"altura":null,"fr":null,"fc":null,"ta":null,"reason_consultation":"<p>Dolor en el diente por ca\u00edda. <strong>Tratamientos con fl\u00faor.<\/strong>&nbsp;Si una caries reci\u00e9n est\u00e1 \r\ncomenzando a aparecer, el tratamiento con fl\u00faor puede ayudarte a \r\nrestaurar el esmalte del diente y, en ocasiones, a revertir la caries en\r\n etapas muy tempranas. Los tratamientos profesionales con fl\u00faor \r\ncontienen m\u00e1s fl\u00faor que la cantidad que se encuentra en el agua del \r\ngrifo, los dent\u00edfricos y los enjuagues bucales.<span style=\"left: 146.8px; top: 398.693px; font-size: 6.4px; font-family: sans-serif; transform: scaleX(1.00211);\" role=\"presentation\" dir=\"ltr\"><\/span><\/p>","imc":null,"tp":null,"cms":null,"saturacion":null,"disease_current":null,"physical_test":null,"observations":"<p><strong>Tratamientos con fl\u00faor.<\/strong>&nbsp;Si una caries reci\u00e9n est\u00e1 \r\ncomenzando a aparecer, el tratamiento con fl\u00faor puede ayudarte a \r\nrestaurar el esmalte del diente y, en ocasiones, a revertir la caries en\r\n etapas muy tempranas. Los tratamientos profesionales con fl\u00faor \r\ncontienen m\u00e1s fl\u00faor que la cantidad que se encuentra en el agua del \r\ngrifo, los dent\u00edfricos y los enjuagues bucales.<\/p>","diagnostic_impression":null,"suggestions":null,"laboratory_conclusions":null,"radiographic_interpretation":null,"treatment_sequence":"<ul style=\"font-family: Helvetica, Arial, sans-serif; margin-right: 0px; margin-bottom: 0px; margin-left: 36px; padding: 0px 0px 24px; color: rgb(17, 17, 17); font-size: 16px;\"><li style=\"line-height: 1.4em; margin-bottom: 12px;\"><strong>Tratamientos con fl\u00faor.<\/strong>&nbsp;Si una caries reci\u00e9n est\u00e1 comenzando a aparecer, el tratamiento con fl\u00faor puede ayudarte a restaurar el esmalte del diente y, en ocasiones, a revertir la caries en etapas muy tempranas. Los tratamientos profesionales con fl\u00faor contienen m\u00e1s fl\u00faor que la cantidad que se encuentra en el agua del grifo, los dent\u00edfricos y los enjuagues bucales. Los tratamientos con fl\u00faor pueden ser l\u00edquidos, en gel, espuma o barniz que se cepilla en los dientes o se coloca en una cubeta peque\u00f1a que se ajusta a los dientes.<\/li><\/ul>","dental_diagnosis":"<p>Fractura.<\/p>"}', 'JORFRAN JESUS SALAZAR MATA', '1', '2022-12-13 13:10:55.716746', 2, '127.0.0.1', 'http://localhost/SAPS/admin/informe/editar/19');
