INSERT INTO public.clinical_histories VALUES (13, 375, NULL, 4, 1, '<p>Se indica mantener indicaciones de tratamiento agudo por diagnósticos descritos.</p><p>Pendiente reevaluación médico tratante y avisar cualquier eventualidad a servicio médico y pendiente paraclínicos solicitados.</p>', 69, '1.69', 55, 55, 55, '<p>Dolor de cabeza constante.<br></p>', '24.16', '55', '55', '120', '<p>Se trata de paciente femenino de 34 años de edad, natural del estado portuguesa y procedente de la localidad quien acude a a consulta médica el día de hoy, por referir IEA hace 1 semana&nbsp; aproximadamente caracterizado por presentar dolor en el oído derecho . En vista de persistir sintomatología acude se evalúa y se decide conducta médica respectiva.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL);
INSERT INTO public.clinical_histories VALUES (14, 96, NULL, NULL, 28, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<div><span style="font-family: Arial;">SE REALIZA&nbsp;</span><b>ULTRASONIDO PÉLVICO</b><span style="font-family: Arial;">, CON TRANSDUCTOR CÓNVEXMULTIFRECUENCIAL, EN INCIDENCIAS LONGITUDINALES, TRANSVERSALES Y OBLICUAS, OBSERVÁNDOSE:</span></div><div><br></div><div><b><span style="font-family: Arial;">PRÓSTATA</span></b><span style="font-family: Arial;">,&nbsp;DE UBICACIÓN, TAMAÑO Y MORFOLOGÍA HABITUAL, ECOGENICIDAD Y ECOPATRÓN ADECUADO. SIN LESIONES FOCALES. MIDE 4.9X4.3X5.7CM. VOLUMEN DE 65.52CC.</span></div><div><br></div><div><b><span style="font-family: Arial;">VESÍCULAS SEMINALES</span></b><span style="font-family: Arial;">, DE CONFIGURACIÓN ANATÓMICA NORMAL.</span></div><div><br></div><div><b><span style="font-family: Arial;">VEJIGA,PRE MICCIONAL</span></b><span style="font-family: Arial;">,&nbsp;PARCIALMENTE PLENA (VOLUMEN DE 146.68), DE PARED DELGADA, SIN IMÁGENES ECOGÉNICAS EN SU INTERIOR.</span></div><div><br></div><div><span style="font-family: Arial;">VEJIGA,POST MICCIONAL,&nbsp;RESIDUO POST MICCIONAL, NO SIGNIFICATIVO.</span></div><div><br></div><div><span style="font-family: Arial;">NO SE EVIDENCIA LÍQUIDO LIBRE EN CAVIDAD ABDOMINAL, AL MOMENTO DEL ESTUDIO.</span></div><div><br></div><div><span style="font-family: Arial;">ASAS INTESTINALES COMPRESIBLES Y PERISTÁLTICAS.&nbsp;</span></div>', '<p class="MsoListParagraphCxSpFirst" style="margin: 0cm 0cm 0.0001pt 18pt; line-height: normal;">CRECIMIENTO PROSTÁTICO, GRADO III/IV.</p><p class="MsoListParagraphCxSpFirst" style="margin: 0cm 0cm 0.0001pt 18pt; line-height: normal;"><span style="font-size: 0.875rem;">RESIDUO
INSERT INTO public.clinical_histories VALUES (18, 493, NULL, NULL, 2, NULL, 0, NULL, NULL, NULL, NULL, 'Dolor en la muela derecha.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '<ul style="margin-right: 0px; margin-bottom: 0px; margin-left: 36px; padding: 0px 0px 24px;"><li style="line-height: 1.4em; margin-bottom: 12px;">Tratamientos con flúor.&nbsp;Si una caries recién está comenzando a aparecer, el tratamiento con flúor puede ayudarte a restaurar el esmalte del diente y, en ocasiones, a revertir la caries en etapas muy tempranas. Los tratamientos profesionales con flúor contienen más flúor que la cantidad que se encuentra en el agua del grifo, los dentífricos y los enjuagues bucales. Los tratamientos con flúor pueden ser líquidos, en gel, espuma o barniz que se cepilla en los dientes o se coloca en una cubeta pequeña que se ajusta a los dientes.</li><li style="line-height: 1.4em; margin-bottom: 12px;">Empastes.&nbsp;Los empastes, a veces llamados «restauraciones», son la opción principal de tratamiento cuando la caries ha avanzado más allá de la primera etapa. Los empastes se hacen con varios materiales, como resinas compuestas del color del diente, porcelana o una amalgama dental que es una combinación de diferentes materiales.</li><li style="line-height: 1.4em; margin-bottom: 12px;"><font color="#111111" face="Helvetica, Arial, sans-serif"><span style="font-size: 16px;">Coronas.</span></font>&nbsp;Si tienes caries extensas o dientes debilitados, es posible que necesites una corona: una cubierta hecha a medida que reemplaza la corona natural completa del diente. El dentista pasará el torno en la zona de la caries y en otras partes del diente para asegurar un buen ajuste. Las coronas pueden ser de oro, porcelana de alta resistencia, resina, porcelana fundida en metal o de otros materiales.</li></ul>', '<p>Caries limitada al esmalte.</p><p>Caries de la dentina.&nbsp;</p><p><span style="font-size: 0.875rem;">Caries del cemento.</span></p>', NULL);
