INSERT INTO public.laboratories VALUES (15, 20, '<p><b>Tratamientos con flúor.&nbsp;</b>Si una caries recién está comenzando a aparecer, el tratamiento con flúor puede ayudarte a restaurar el esmalte del diente y, en ocasiones, a revertir la caries en etapas muy tempranas. Los tratamientos profesionales con flúor contienen más flúor que la cantidad que se encuentra en el agua del grifo, los dentífricos y los enjuagues bucales. <br></p>', '2022-12-13 14:19:58.160771', '2022-12-13 15:49:32.807622');
